import React, { useContext } from 'react';
import { useParams } from 'react-router-dom';
// import { ToursContext } from '../context/ToursContext';
import tours from '../DB/Tuscany.json';
import { ToursContext } from '../context/ToursContext';

export default function SpecificTour() {
  const { id } = useParams(); 
  const {tours} = useContext(ToursContext);

  // const tour = tours.find(tour => tour.id === parseInt(id));

  if (!tours || tours.length === 0) {
    return <p>Tour not found.</p>;
  }
  console.log(tours);

  return (
    <section>
        <section 
        className="tour"
        key={tours.id}>
          <h2>{tours.title}</h2>
          <p>{tours.description}</p>
        </section>
    </section>
  );
}
